import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import axios from "axios";
import { useState } from "react";
import Swal from "sweetalert2";

const Login = () => {
  const [loginInfo, setLoginInfo] = useState({
    username: "",
    password: "",
    deviceInfo: {
      deviceId: "1",
      deviceType: "DEVICE_TYPE_WINDOWS",
      notificationToken: "111",
    },
  });

  const onChange = (e) => {
    if (e.target.id === "username") {
      setLoginInfo({
        ...loginInfo,
        username: e.target.value,
      });
    } else if (e.target.id === "password") {
      setLoginInfo({
        ...loginInfo,
        password: e.target.value,
      });
    }
  };

  const onSubmit = (e) => {
    e.preventDefault();
    console.log(loginInfo);
    axios
      .post("http://localhost:8080/api/auth/login", loginInfo)
      .then((res) => {
        console.log(res);
        const { accessToken, refreshToken, tokenType, expiryDuration } =
          res.data;
        console.log(accessToken);
        console.log(refreshToken);
        console.log(tokenType);
        console.log(expiryDuration);

        axios.get("http://localhost:8080/api/user/me").then((res) => {
          console.log(res);
        });
      })
      .catch((err) => {
        Swal.fire({
          title: "로그인 오류",
          text: "아이디 또는 비밀번호를 입력하세요",
          icon: "error",
        });
      });
  };

  return (
    <Form className="container" onSubmit={onSubmit}>
      <Form.Group className="mb-3" controlId="username">
        <Form.Label>아이디</Form.Label>
        <Form.Control
          type="text"
          placeholder="아이디를 입력하세요."
          onChange={onChange}
        />
      </Form.Group>

      <Form.Group className="mb-3" controlId="password">
        <Form.Label>비밀번호</Form.Label>
        <Form.Control
          type="password"
          placeholder="비밀번호를 입력하세요."
          onChange={onChange}
        />
      </Form.Group>
      <Button variant="primary" type="submit">
        로그인
      </Button>
    </Form>
  );
};
export default Login;
